import { useNavigate } from "react-router-dom";
import '../../css/auth.css'

export const Login =()=>{
    let navigate = useNavigate()
    return (
        <div className="authorize">
            <h1>WebShell</h1>
            <label>Логин</label><p/>
            <input className="inputAuth"/><p/>
            <label>Пароль</label><p/>
            <input className="inputAuth"/><p/>
            <a href="http://localhost:3000/register">Регистрация</a><p/>
            <button  className='buttonAuth' onClick={()=>{navigate("/console")}} type='submit' value='Отправить'/>
        </div>
    );
}
